import React from 'react';
import './App.css';
import Headers from './components/home/Header';
import Article from './components/home/Article';
import Footer from './components/home/Footer';


function AppHome() {

  return (
    <>
      <Headers />
      <Article />
      <Footer />
    </>
  );
}

export default AppHome;
